import logo from './logo.svg';
import './App.css';
import React, {useEffect, useState} from 'react'
import axios from 'axios';

function App() {
	const [outPut, setOutput] = useState('')

	useEffect(() => {
		translateApi("How are you doing my good sir")
	}, [])
	const translateApi = async (input) => {
		const encodedParams = new URLSearchParams();
		encodedParams.set('q', input);

		const options = {
			method: 'POST',
			url: 'https://google-translate1.p.rapidapi.com/language/translate/v2/detect',
			headers: {
				'content-type': 'application/x-www-form-urlencoded',
				'Accept-Encoding': 'application/gzip',
				'X-RapidAPI-Key': '5ffffbeff6msh142b6494b8f2442p104da0jsnf635f4f2888c',
				'X-RapidAPI-Host': 'google-translate1.p.rapidapi.com'
			},
			data: encodedParams,
		};



		try {
			const response = await axios.request(options);
			console.log(response.data);
			// setOutput(response.data)
		} catch (error) {
			console.error(error);
		}
	}

	var myVar = "hey"
	return (
		<div className="App">
			<header className="App-header">
				<img src={logo} className="App-logo" alt="logo" />
				<p>
					Edit <code>src/App.js</code> and save to reload. {outPut}
				</p>
				<a
					className="App-link"
					href="https://reactjs.org"
					target="_blank"
					rel="noopener noreferrer"
				>
					Learn React
				</a>
			</header>
		</div>
	);
}

export default App;
